import { Row } from "antd";
import React from "react";

import { ItemCard } from "./Cards";

function JeansItem() {
  return (
    <div
      className="site-layout-background col-lg-12 p-4"
      style={{
        minHeight: "100%",
        minWidth: "100%",
        flexDirection: "row",
        backgroundColor: "lightgrey",
      }}
    >
      <Row gutter={10}>
        <ItemCard img={imgArray[0]} title="Denim Brand Jeans" price="2699" />

        <ItemCard
          img={imgArray[1]}
          title="Urban Classic Slim Jean"
          price="2199"
        />

        <ItemCard img={imgArray[2]} title="Slim Fit Denim Jean" price="2399" />

        <ItemCard
          img={imgArray[3]}
          title="Low Rise Skinny Fit Jean"
          price="2699"
        />
      </Row>
    </div>
  );
}

export default JeansItem;
